import React, { Component } from 'react';

import test from '../../Home/test.png'



class Conhome extends Component {
    constructor(props) {
        super(props);
    
        this.toggle = this.toggle.bind(this);
        this.state = {
          isOpen: false
        };
      }
      toggle() {
        this.setState({
          isOpen: !this.state.isOpen
        });
      }
      
    render() {
        return (
            <div  >
                <img src = {test} alt="test" width="100%" height="100%"/>

            </div>
        )

    }
}
export default Conhome;
